CREATE TABLE plates (
  id integer primary key autoincrement,
  general_id varchar(255) default NULL,
  general_checked varchar(255) default NULL,
  general_name varchar(255) default NULL,
  general_name_short varchar(255) default NULL,
  general_description varchar(255) default NULL,
  general_comment varchar(255) default NULL,
  general_image varchar(255) default NULL,
  manufacturer_name varchar(255) default NULL,
  manufacturer_url varchar(255) default NULL,
  manufacturer_product_url varchar(255) default NULL,
  manufacturer_number varchar(255) default NULL,
  manufacturer_pdf_url varchar(255) default NULL,
  id_momentum varchar(255) default NULL,
  id_evo varchar(255) default NULL,
  id_infinite varchar(255) default NULL,
  id_barcode varchar(255) default NULL,
  plate_bottom_read varchar(255) default NULL,
  plate_color varchar(255) default NULL,
  plate_type varchar(255) default NULL,
  plate_material varchar(255) default NULL,
  plate_rows varchar(255) default NULL,
  plate_columns varchar(255) default NULL,
  plate_numbering varchar(255) default NULL,
  plate_height varchar(255) default NULL,
  plate_length varchar(255) default NULL,
  plate_width varchar(255) default NULL,
  plate_sterile varchar(255) default NULL,
  flange_type varchar(255) default NULL,
  flange_height_short varchar(255) default NULL,
  flange_height_long varchar(255) default NULL,
  flange_width varchar(255) default NULL,
  stacking_above varchar(255) default NULL,
  stacking_below varchar(255) default NULL,
  stacking_plate_height varchar(255) default NULL,
  stacking_plate_shift varchar(255) default NULL,
  well_size varchar(255) default NULL,
  well_coating varchar(255) default NULL,
  well_shape varchar(255) default NULL,
  well_bottom varchar(255) default NULL,
  well_profile varchar(255) default NULL,
  well_profile_anlge varchar(255) default NULL,
  well_diameter_bottom_x varchar(255) default NULL,
  well_diameter_bottom_y varchar(255) default NULL,
  well_diameter_top_x varchar(255) default NULL,
  well_diameter_top_y varchar(255) default NULL,
  well_position_first_x varchar(255) default NULL,
  well_position_first_y varchar(255) default NULL,
  well_distance_x varchar(255) default NULL,
  well_distance_y varchar(255) default NULL,
  well_position_last_x varchar(255) default NULL,
  well_position_last_y varchar(255) default NULL,
  well_volume_total varchar(255) default NULL,
  well_area varchar(255) default NULL,
  well_depth varchar(255) default NULL,
  well_volume_max varchar(255) default NULL,
  well_volume_working_min varchar(255) default NULL,
  well_volume_working_max varchar(255) default NULL,
  lid_allowed varchar(255) default NULL,
  lid_offset varchar(255) default NULL,
  lid_plate_height varchar(255) default NULL,
  momentum_grip_force varchar(255) default NULL,
  momentum_offsets_low_lidded_plate varchar(255) default NULL,
  momentum_offsets_low_lidded_lid varchar(255) default NULL,
  momentum_offsets_low_grip_transform varchar(255) default NULL,
  momentum_offsets_high_lidded_plate varchar(255) default NULL,
  momentum_offsets_high_lidded_lid varchar(255) default NULL,
  momentum_offsets_high_grip_transform varchar(255) default NULL,
  momentum_offsets_custom_lidded_plate varchar(255) default NULL,
  momentum_offsets_custom_lidded_lid varchar(255) default NULL,
  momentum_offsets_custom_grip_transform varchar(255) default NULL,
  evo_plate_grip_force varchar(255) default NULL,
  evo_lid_grip_force varchar(255) default NULL,
  evo_lid_grip_narrow varchar(255) default NULL,
  evo_lid_grip_wide varchar(255) default NULL
);

